namespace BreadBadger9000
{
    internal class Program
    {
        static void Main(string[] args)
        {
            for (int i = 1; i < 100; i++)
            {

                if (i % 7 == 0) break;

                int a = i;

                a = a * 7;
                a = a + 9;
                a = a * a;
                Console.WriteLine(a);

            }
        }
    }
    interface iHonker
    {
       public void Honk();
    }
    class Vehicle : iHonker
    {

        int wheels = 4;
        protected string name = "";
        public Vehicle(string vehicleName)
        {
            name = vehicleName;
        }
        public void Honk()
        {
            Console.WriteLine("beepiddy beep beep");
        }
    }
    class Goose : iHonker
    {
        string name = "Untitled Goose";

        public Goose(string gooseName)
        {
            name = gooseName;
        }
        public void Honk()
        {
            Console.WriteLine("");
        }
    }
}